import React, { Component } from 'react';

class Linker extends Component {
    render() { 
        return (
            <div className='linkers'>
                <ul>
                <li><>Twitter</></li>
                <li><>Zuri Team</></li>
                <li><>Zuri Books</></li>
                <li><>Python Books</></li>
                <li><>Background Check For Codes</></li>
                <li><>Design Books</></li>
            </ul>
            </div>
        );
    }
}
 
export default Linker;
